 in test.\n\nFor Trees, we one-hot encode the Sex category, although it is not strictly required in R.","metadata":{}},{"cell_type":"code","source":"library(bestNormalize)\n\n# Fit the transformation\nyj_model <- yeojohnson(train$Calories)\n\n# Apply the transformation using predict()\ntrain <- train %>% mutate(\n  log_calories = log1p(Calories),\n  yj_calories = predict(yj_model)\n)\n\n# Visualize\nggplot(train, aes(x = yj_calories)) + \n  geom_density() + \n  ggtitle(\"Calories Yeo-Johnson transformed\")\n","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-06T12:38:05.215887Z","iopub.execute_input":"2025-05-06T12:38:05.217415Z","iopub.status.idle":"2025-05-06T12:38:06.713943Z","shell.execute_reply":"2025-05-06T12:38:06.71193Z"}},"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABaAAAAPACAIAAABM5kn/AAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0ATdx8G8O9dJktkKDLcW3HUiloHVnEXJ6KguHDWrajgpFJH3ds6cdE6iptS\nZ12tC+vAgXsUF4IsgZCQ5N4/zvoqogZIuASez19yudw9dzlD8nD3O4bjOAIAAAAAAAAAMGWs\n0AEAAAAAAAAAAPILBQcAAAAAAAAAmDwUHAAAAAAAAABg8lBwAAAAAAAAAIDJQ8EBAAAAAAAA\nACYPBQcAAAAAAAAAmDwUHAAAAAAAAABg8lBwAAAAAAAAAIDJKwwFB6d5s291iHebRqVL2ZtJ\npNa2Jb9q2jZocVhClja3i4qe58YwjMf+x/lP9c/kugzDtD/1PP+L+oy7oV0YhmFF8u3P0nOc\ngVMne9iaMQxTfcjvBk2SI34nVPY9natn3dvizjCM+5Z7BkoFGS9PDPD42t5S6lBzitBZ8mhJ\nRRuGYSKTMoUOAgAAAAAAxsLkC470Z3+2reTcdURw+NEL8Rnk4OzAKBKv/n1kXkCfClXanH1d\nyL//VBkQPqSSNadVjv5uTo4zXFvS6c+kTIlFrcjl7Qo4GxARp03/+++/L1yKFTrIB4Kbddv8\n52VJ1Wbt3CsLnQUAAAAAAEA/TLvgUCvutHX97ujjN2W/9Y+8cC8zNeHx49jk9DfRx7d3rWX7\n5vHxDg2GKzlhspXz/nHz5s0B1WwMuxpGvODIYinLJFybM/LYs2wPZqVf8Zx+loi8NuwrLxcZ\nNgnkRK2427Rp0zZe64UO8h5OtexBisS8+oOoY1t+HiB0GgAAAAAAAP0w7YJjS7fWfydnurSb\nefv4xvYNKr2dyprVaunzW9TV5taylIebhhj4IpFPsavXsV+/fq0czAy9omLl/XcPqkZEG3v0\nTVJ/UOccHNrjmVJTvMqIX3wqGDoGmApOq8jiOIl5TXOWEToLAAAAAACA3phwwZGZePD7w09F\nUseD4ZPlH22HSFZ6yZgaRHQo4GhBJ+OUr3I//Ed+tF/+Rz1LaWbSn54//fNuYtrTX3y3P2BY\nycJDc0z4ZdaVNj1TbZLryvvRUpCbnJOPknOaDIVKI1QcAAAAAAAo4kz4m++9jT9mcZyz