 Bin age into  4 life stages (custom cut)\n  step_mutate(\n    age_group = factor(case_when(\n      Age <= 25 ~ \"young\",\n      Age <= 45 ~ \"adult\",\n      Age <= 65 ~ \"midlife\",\n      TRUE      ~ \"senior\"\n    ))\n  ) %>%\n  step_ns(Age, deg_free = 4) %>%\n\n  # One-hot encode categorical variables\n  step_dummy(all_nominal_predictors()) \n\n\n\n\n\nrecipe_tree %>% prep %>% juice %>% head\nrecipe_tree %>% prep %>% juice %>% plot_histogram(., position=\"identity\", alpha=0.5)","metadata":{"trusted":true,"execution":{"iopub.status.busy":"2025-05-06T12:38:26.482641Z","iopub.execute_input":"2025-05-06T12:38:26.484442Z","iopub.status.idle":"2025-05-06T12:38:51.125669Z","shell.execute_reply":"2025-05-06T12:38:51.123609Z"}},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 6 × 18</caption>\n<thead>\n\t<tr><th scope=col>Height</th><th scope=col>Weight</th><th scope=col>Duration</th><th scope=col>Heart_Rate</th><th scope=col>Body_Temp</th><th scope=col>log_calories</th><th scope=col>BMI</th><th scope=col>Temp_Deviation</th><th scope=col>log_HR_per_min</th><th scope=col>log_Temp_per_min</th><th scope=col>Age_ns_1</th><th scope=col>Age_ns_2</th><th scope=col>Age_ns_3</th><th scope=col>Age_ns_4</th><th scope=col>Sex_male</th><th scope=col>age_group_midlife</th><th scope=col>age_group_senior</th><th scope=col>age_group_young</th></tr>\n\t<tr><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>189